import React, { useState } from 'react';
import './prev.css';
import Snackbar, { SnackbarOrigin } from '@mui/material/Snackbar';
import {
  TableBody,
  TableCell,
  TableRow,
  TableHead,
  TableContainer,
  Table,
  Paper
} from '@mui/material';


export default function Preview() {
  return (
    <>
      <div className='preview'>
        <Snackbar
          open={true}
          sx={{ height: '0%' }}
          anchorOrigin={{
            vertical: 'top',
            horizontal: 'center',
          }}
          position='top'
          autoHideDuration={6000}
          message='Workout is added successfully'
        />
        
        <div className='workoutdata'>
          <h1>Workout Preview</h1>
        </div>
        
      </div>
    
    </>
  );
}
